import React from "react";
import "./RecentProjects.css"

const RecentProjects = () => {

    return (
        <div className="recent__projects__wrapper">
            <div className="projects__picture__wrapper">
                Picture
            </div>
            <div className="bio__content">
                Hi! My name is Jamie Kuesel. 
                I'm a fourth year Computer Science student at Northeastern University with a concentration in Artificial Intelligence.
                I'm also interested in Computer Vision, Noise Generation, Vizualizations, and Web Development.
            </div>
        </div>
    )
}

export default RecentProjects;
